import React from 'react';
import ReactDOM from 'react-dom';

class Header extends React.Component {
  render() {
    return (
      <header>
        <div className="header_logo">
          <img src="src/logo.png" />
        </div>
      </header>
    );
  }
}

ReactDOM.render(
  <Header />,
  document.getElementById('root')
);
